import React from "react";
import "./App.css";
import Header from "./components/Header";
import Container from "./components/Container";

function App() {
  function searchBooks(query) {
    console.log("our search is: " + query);
  }

  return (
    <div className="App">
      <Header searchBooks={this.searchBooks.bind(this)} />
      <Container />
    </div>
  );
}

export default App;
